import React, { useEffect, useState } from 'react';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

function MyNavbar() {
  const [userData, setUserData] = useState(null);
  const navigate = useNavigate();

  // Fetch the username from localStorage or fetch user data if token is available
  const getUser = async () => {
    const token = localStorage.getItem('token');
    const username = localStorage.getItem('username');
    
    if (username) {
      setUserData(username);  // If username is in localStorage, set it directly
    } else if (token) {
      try {
        const response = await axios.get('http://localhost:8080/user', {
          headers: { Authorization: `Bearer ${token}` },
          withCredentials: true
        });
        
        if (response.data.user) {
          const { username } = response.data.user;
          setUserData(username);
          localStorage.setItem('username', username);
          localStorage.setItem('token', username);
        }
      } catch (error) {
        console.log('User not logged in:', error);
      }
    }
  };

  useEffect(() => {
    getUser(); // Fetch or set user on load
  }, []);

  const handleLogout = async () => {
    try {
      const token = localStorage.getItem('token');
      await axios.get('http://localhost:8080/logout', {
        headers: { Authorization: `Bearer ${token}` },
        withCredentials: true
      });
      localStorage.removeItem('token');
      localStorage.removeItem('username');
      setUserData(null);
      navigate('/');
      window.location.reload();
    } catch (error) {
      console.log('Error logging out:', error);
    }
  };

  return (
    <Navbar bg="white" expand="lg" fixed="top">
      <Container fluid>
        <Navbar.Brand href="/">Navbar</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarNavAltMarkup" />
        <Navbar.Collapse id="navbarNavAltMarkup">
          <Nav className="ms-auto">
            <Nav.Link href="#sectionHome" className="active">Home</Nav.Link>
            <Nav.Link href="#sectionKeyFeatures">Key Features</Nav.Link>
            <Nav.Link href="#sectionUploadAndDiagnosis">Upload and Diagnostic</Nav.Link>
            <Nav.Link href="#">Follow Us</Nav.Link>

            {userData ? (
              <NavDropdown title={userData} id="usernameDropdown">
                <LinkContainer to="/profile">
                  <NavDropdown.Item>Profile</NavDropdown.Item>
                </LinkContainer>
                <NavDropdown.Item onClick={handleLogout} className="text-danger">
                  Logout
                </NavDropdown.Item>
              </NavDropdown>
            ) : (
              <Link to="/signup" className="nav-link">Sign Up</Link>
            )}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default MyNavbar;
